@mixin onTablet {
  @media (min-width: 768px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1200px) {
    @content;
  }
}

* {
  box-sizing: border-box;
}

.page {
  font-family: Inter, sans-serif;
  font-weight: 400;
  font-size: 14px;
  line-height: 21px;
  color: #333;
  &__body {
    margin: 0;
    background-color: #f7f7f7;
  }
  &__section {
    max-width: 1194px;
    margin: 0 auto 110px;
    padding: 0 30px;
  }
}

h1,
h2,
h3,
ul,
p {
  margin: 0;
  padding: 0;
}

.grid {
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 20px;
  @include onTablet {
    grid-template-columns: repeat(8, 1fr);
  }
  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
    gap: 30px;
  }

  &__item {
    @for $start from 1 through 4 {
      @for $end from $start through 4 {
        &--mobile-#{$start}-#{$end} {
          grid-column: #{$start}/#{$end+1};
        }
      }
    }

    @for $start from 1 through 8 {
      @for $end from $start through 8 {
        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }

    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start}/#{$end+1};
          }
        }
      }
    }
  }
}

.header {
  height: 100vh;
  &__top {
    display: flex;
    justify-content: space-between;
    padding: 26px 0;
    align-items: center;
    @include onTablet {
      margin-bottom: 130px;
    }
  }
  &__nav {
    display: none;
    @include onTablet {
      display: flex;
      align-items: center;
      gap: 26px;
    }
  }
  &__item {
    font-weight: 300;
    font-size: 14px;
    line-height: 17px;
    color: #4f4f4f;
    text-decoration: none;
  }

  &__label {
    font-weight: 400;
    font-size: 14px;
    line-height: 18px;
    color: #828282;
    text-transform: uppercase;
    cursor: pointer;
  }

  &__input {
    display: none;
    &:checked + label {
      color: red;
    }
  }
  &__button {
    width: 102px;
    height: 48px;
    display: flex;
    justify-content: center;
    align-items: center;
    background: #333;
    text-align: center;
    text-decoration: none;
    font-weight: 500;
    font-size: 12px;
    line-height: 15px;
    color: #fff;
    text-transform: uppercase;
    &:hover {
      background: #131313;
    }
  }

  &__container {
    display: flex;
    flex-direction: column;
    @include onTablet {
      position: relative;
      z-index: 1;
    }
  }

  &__box-img {
    width: 100%;
    display: block;
    margin: 0 auto;
    min-width: 320px;
    @include onTablet {
      position: absolute;
      top: -50px;
      right: 35px;
      z-index: -1;
      max-width: 430px;
    }
    @include onDesktop {
      max-width: 816px;
      right: 0;
      top: -280px;
    }
  }

  &__img {
    display: block;
    padding-bottom: 100%;
    background-image: url(../images/header-mob.svg);
    background-position: center;
    background-size: contain;
    background-repeat: no-repeat;

    @include onTablet {
      background-image: url(../images/headtabl.svg);
    }
    @include onDesktop {
      background-image: url(../images/headdesk.svg);
      background-position: right;
      background-size: auto;
    }
  }

  &__title {
    padding: 40px 30px 20px;
    text-transform: uppercase;
    font-weight: 700;
    font-size: 40px;
    line-height: 52px;
    width: 260px;
    @include onTablet {
      font-size: 48px;
      line-height: 62px;
      width: 340px;
      padding: 0;
      margin-bottom: 30px;
    }
    @include onDesktop {
      font-size: 62px;
      line-height: 78px;
      width: 378px;
    }
  }
  &__description {
    padding: 0 30px;
    @include onTablet {
      width: 250px;
      padding: 0;
    }
  }
}

.menu {
  display: none;
  @include onDesktop {
    display: block;
    padding: 28px;
    &__nav {
      display: flex;
      gap: 84px;
      justify-content: center;
      list-style: none;
    }
    &__link {
      font-weight: 400;
      font-size: 14px;
      line-height: 20px;
      color: #333;
      text-decoration: none;
    }
  }
}

